window.bookSummaryJSON = "<p>After surviving Adrian's brutal attack, Laurel finds herself on Olympus once again, faced with a trial that could sentence Sam to years of slumber. </p> <p>Meanwhile, Sam is haunted by the torturous vision of Laurel dying in childbirth, and Laurel's determination to continue the pregnancy despite Sam's opposition takes a heavy toll on their relationship. Sam winds up absconding and leaving Olympus, while Laurel seeks refuge on a Greek island in hopes of giving birth away from any threats. </p> <p>In a twist of events where nothing is what it seems, Laurel gets help from an unexpected source and is once again forced to leave behind everyone in her life to find safety. The only way she can ever return to Sam is if the dominion of the Keepers is destroyed, but just when things are looking up, Adrian discovers Laurel's refuge, and everything changes drastically. </p> <p>In a clash where it is hard to know who is a friend and who is an enemy, it will be a race against the clock for Sam to take down Olympus and rescue those he loves. </p> <p>Contains mature themes.</p>"; 
